CONSTRUCT {

?s a ?Category

}WHERE{

?s a ?Category

} LIMIT 1000

PREFIX dcmiterms: <http://purl.org/dc/terms/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
CONSTRUCT {
  <http://dbpedia.org/resource/Spain> dcmiterms:subject ?categoryUri.
  ?categoryUri rdfs:label ?categoryName.
  }WHERE{
  <http://dbpedia.org/resource/Spain> dcmiterms:subject ?categoryUri.
  ?categoryUri rdfs:label ?categoryName.
  FILTER (lang(?categoryName) = "en")
} LIMIT 1000

